import './App.css';
import { createTheme, ThemeProvider } from '@mui/material/styles';
import Navbar from './components/Navbar';
import Container from '@mui/material/Container';

const theme = createTheme({
  palette: {
    primary: {
      light: '#4f5b62',
      main: '#263238',
      dark: '#000a12',
      contrastText: '#fff',
    },
    secondary: {
      light: '#ffffff',
      main: '#efebe9',
      dark: '#bdb9b7',
      contrastText: '#000',
    },
  },
});

function App() {
  return (
  <>
  <ThemeProvider theme={theme}>
  <Container sx={{ 
    maxWidth: 1400,
    backgroundColor: 'primary.light' }}>
  <Navbar/>
  </Container>
  </ThemeProvider>
  </>
  )
}


export default App;
